import React from 'react'
import list from "../Home/data";
import './Home.css'
import Cards from '../Cards/Cards';

const Home = () => {
  return (
    <section>
        {
           list.map((item)=>{
             <Cards item={item}/>
           }) 
        }
    </section>
  )
}

export default Home
